import React from "react";
import { Card } from "../../UI/Card.styled";

const Form = (fontSizes, UI, color) => {
  return (
    <Card mg={"1rem 10rem"} bd={"1px solid red"} height={"10rem"}>
      <Card cl={color.darkGrey} fs={fontSizes.textHeader} fw={"700"}>
        Interested to work together? Let's talk
      </Card>
    </Card>
  );
};

export default Form;
